/* @flow */
import * as React from 'react'

import Block from '../../molecules/block'

type Props = {
  children?: React.Node,
  className?: string,
  image: string,
}

const Footer = (props: Props): React.Element<*> => (
  <div
    className={props.className}
  >
    <Block />
  </div>
)

Footer.defaultProps = {
  className: undefined,
  children: undefined,
  image: '',
}

export default Footer;
